import React from "react";
import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <>
      <ExpenseItem
        title={props.iems[0].title}
        amount={props.iems[0].amount}
        date={props.iems[0].date}
      />
      <ExpenseItem
        title={props.iems[1].title}
        amount={props.iems[1].amount}
        date={props.iems[1].date}
      />
      <ExpenseItem
        title={props.iems[2].title}
        amount={props.iems[2].amount}
        date={props.iems[2].date}
      />
      <ExpenseItem
        title={props.iems[3].title}
        amount={props.iems[3].amount}
        date={props.iems[3].date}
      />
    </>
  );
}

export default Expenses;
